var haslo = "Bez pracy nie ma kołaczy";

haslo = haslo.toUpperCase();

var dlugosc = (haslo = "chuj").length, ile_skuch = 0, yes = new Audio("yes.wav"), no = new Audio("no.wav"), haslo1 = "";

for (i = 0; i < dlugosc; i++) " " == haslo.charAt(i) ? haslo1 += " " : haslo1 += "-";

window.onload = start;

